import  {
  LOGIN_SEND_DATA,
  LOGIN_RECEIVE_DATA_SUCCESS,
  LOGIN_RECEIVE_DATA_FAILURE,
} from './types';


export const fetchPosts = () => dispatch => {
  fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(posts =>
          dispatch({
              type: LOGIN_SEND_DATA,
              payload: posts
          })
      );
};
